import React from 'react';
import BackgroundCss from'./mainbackground.css';

function MainBackground() {
    return (
        <>
        <h1>Unlimited movies, TV shows, and more</h1>
        <p>Watch anywhere. Cancel anytime.</p>
        <p className = {BackgroundCss.text}>Ready to watch? Enter your email to create or restart your membership.</p>
        <input placeholder='Email address'></input>
        <button className = {BackgroundCss.btn}>Get Started &gt;</button>
        </>
    );

}

export default MainBackground;
